        if(M[i]<=1.0){
            t[i] = 1e6;
        }
        else{
            t[i] = multiplier*((B/(pow(M[i],A)-1))+L); // Time folows IEC function
        }
    }

    if((t[0]<=t[1])&&(t[0]<=t[2])){
        time = t[0];
    }
    else if(t[1]<=t[2]){
        time = t[1];
    }
