        if(Irms[i]>Ipk_2){
            Flag = 1;
            break;
        }
        else{
            Flag = 0;
        }
    }
}
    if(counter > time){
        out = 1;
        trans = 1;
    }
    else{
        out = 0;
        trans = 0;
    }

    counter *= Flag;

    counter += Flag  * Ts;
// OUTPUT
OUT = out;
    time_out = time;
